import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
	  <img src="/images/logo.png" alt="EZNote" style="align:left;"></img>
          <p>Header</p>
        </header>
	<div id="body">
	  <p>Test2</p>
	</div>
      </div>
    );
  }
}

export default App;
